import React, { useState, useContext } from 'react';
import { Link } from "react-router-dom";
import "./css/Header.css";
import Context from './Context';

export default function HeaderNav() {
    
    const { setMobile } = useContext(Context);

    return (
        <div className="HeaderNav-wrapper">
            <ul className="Header-nav-mobile">
                <li className="Header-item">
                    <Link to="/" onClick={e => setMobile(false)}>home</Link>
                </li>
                <li className="Header-item">
                    <Link to="/about" onClick={e => setMobile(false)}>about</Link>
                </li>
                <li className="Header-item">
                    <Link to="/portfolio" onClick={e => setMobile(false)}>portfolio</Link>
                </li>
                <links className="Header-item">
                    <Link to="/contact" onClick={e => setMobile(false)}>contact</Link>
                </links>
                <li className="Header-item">
                    <Link to="/blog" onClick={e => setMobile(false)}>blog</Link>
                </li>
            </ul>
        </div>
    )
};
